import React from 'react';
import HomeLogo from './../images/Home.png';
import './styles/Home.css';

const Home = () => {
    return (
        <React.Fragment>
            <div className='HomeContent'>
                <div>
                    <img src={HomeLogo} alt='Home logo' className='HomeLogo'/>
                </div>
                <h2>Stay Curious</h2>
                <br/>
                <p>Register now</p>
            </div>    
        </React.Fragment>
    )
}

export default Home;
